import React from 'react';

const Footer = () => {
  return (
    <footer>
      <p>Contact me at <a href="mailto:gilarellano1996@gmail.com">gilarellano1996@gmail.com</a></p>
      <p>Follow me on <a href="https://linkedin.com/in/gilbertoarellano/" target="_blank" rel="noopener noreferrer">LinkedIn</a> and <a href="https://github.com/gilarellano" target="_blank" rel="noopener noreferrer">GitHub</a></p>
    </footer>
  );
};

export default Footer;
